import React, { useState } from 'react'

function TodoForm() {
    const [input, setInput] = useState('')

    return (
        <form className='todo-form'>
            <input
                type='text'
                placeholder='Create To Do'
                value={input}
                name='text'
                className='todo-input'
            />
            <button className='todo-button'>Create</button>
        </form>
    )
}

export default TodoForm
